import React from 'react'
import "../Style/leftMenu.css"
import {FaSpotify, FaEllipsisH} from "react-icons/fa"

function LeftMenu() {
  return (
    <div className='leftMenu'>
      <div className ="logoContainer">
        <i><FaSpotify/></i>
        <h2>Spotify</h2>
        <i><FaEllipsisH/></i>
        <div className="searchbox"></div>
      </div>

    </div>
  )
}

export { LeftMenu};
